        @SuppressLint("UnsafeExperimentalUsageError")
        @androidx.camera.core.ExperimentalGetImage
        fun toBitmap(yuvToRgbConverter: YuvToRgbConverter, imageProxy: ImageProxy): Bitmap? {
            val image = imageProxy.image ?: return null

            // Initialise Buffer
            // The image rotation and RGB image buffer are initialized only once
            Helpers.printLog("Initalize toBitmap()")
            val rotationMatrix = Matrix()
            rotationMatrix.postRotate(imageProxy.imageInfo.rotationDegrees.toFloat())
            var bitmapBuffer = Bitmap.createBitmap(
                imageProxy.width, imageProxy.height, Bitmap.Config.ARGB_8888
            )

            // Pass image to an image analyser
            yuvToRgbConverter.yuvToRgb(image, bitmapBuffer)

            // Create the Bitmap in the correct orientation
            return Bitmap.createBitmap(
                bitmapBuffer,
                0,
                0,
                bitmapBuffer.width,
                bitmapBuffer.height,
                rotationMatrix,
                false
            )
        }

        fun isImageUri(context: Context, uriString: String): Boolean {
            return try {
                val uri = Uri.parse(uriString)
                val contentResolver = context.contentResolver
                val type = contentResolver.getType(uri)

                // Check if the MIME type starts with "image/"
                type?.startsWith("image/") == true
            } catch (e: Exception) {
                e.printStackTrace()
                false
            }
        }

        fun getRealPathFromUri(uri: Uri, contentResolver: ContentResolver): String? {
            val projection = arrayOf(MediaStore.Images.Media.DATA)
            val cursor = contentResolver.query(uri, projection, null, null, null)
            cursor?.use {
                if (it.moveToFirst()) {
                    val columnIndex = it.getColumnIndexOrThrow(MediaStore.Images.Media.DATA)
                    return it.getString(columnIndex)
                }
            }
            return null
        }

        fun convertBitmapToFile(context: Context, srcBmp: Bitmap): File {
            val wrapper = ContextWrapper(context)
            var file = wrapper.getDir("Images", Context.MODE_PRIVATE)
            file = File(file, "${UUID.randomUUID()}.jpg")
            val stream: OutputStream = FileOutputStream(file)
            srcBmp.compress(Bitmap.CompressFormat.JPEG, 100, stream)
            stream.flush()
            stream.close()
            return file
        }


        fun resizeBitmapToBitmap(srcBmp: Bitmap): Bitmap {
            val image = convertBitmapToBytes(srcBmp)//srcBmp.convertToByteArray()
            return BitmapFactory.decodeByteArray(image, 0, image.size)
        }

        fun resizeImageFromGallery(bitmap: Bitmap): Bitmap {
            val ratio = min(
                if (bitmap.width > 6479) 6f else if (bitmap.width > 5399) 5f else if (bitmap.width > 4319) 4f else if (bitmap.width > 3240) 3f else if (bitmap.width > 2159) 2f else if (bitmap.width >= 1619) 1.5f else if (bitmap.width >= 1400) 1.3f else 1f,
                if (bitmap.height > 6479) 6f else if (bitmap.height > 5399) 5f else if (bitmap.height > 4319) 4f else if (bitmap.height > 3240) 3f else if (bitmap.height > 2159) 2f else if (bitmap.height > 1619) 1.5f else if (bitmap.height > 1400) 1.3f else 1f
            )
            val desiredWidth = (bitmap.width / ratio).toInt()
            val desiredHeight = (bitmap.height / ratio).toInt()
            val scaledBitmap = Bitmap.createScaledBitmap(bitmap, desiredWidth, desiredHeight, true)
            return scaledBitmap
        }

        fun convertBitmapToBytes(srcBmp: Bitmap): ByteArray {
            val stream = ByteArrayOutputStream()
            srcBmp.compress(Bitmap.CompressFormat.JPEG, 90, stream)
            return stream.toByteArray()
        }

        fun compressBitmapToJpeg(bitmap: Bitmap, quality: Int): Bitmap {
            Helpers.printLog("Original Bitmap: ${bitmap.byteCount / 1024 / 1024f}")
            val byteArrayOutputStream = ByteArrayOutputStream()
            // Compress the bitmap as a JPEG with the specified quality
            bitmap.compress(Bitmap.CompressFormat.JPEG, quality, byteArrayOutputStream)
            val image = byteArrayOutputStream.toByteArray()
            return BitmapFactory.decodeByteArray(image, 0, image.size)
        }


        fun convertBase64ToBytes(base64: String): ByteArray {
            return Base64.decode(base64, Base64.DEFAULT)
        }

        fun Bitmap.convertToByteArray(): ByteArray {
            val startTime = System.currentTimeMillis()
            val stream = ByteArrayOutputStream()
            this.compress(Bitmap.CompressFormat.JPEG, 90, stream)
            val bytes = stream.toByteArray()
            Helpers.printLog("Exceed time convertToByteArray ${System.currentTimeMillis() - startTime}")
            return bytes
        }

        fun convertBitmapToBase64(srcBmp: Bitmap): String {
            val byteArray = srcBmp.convertToByteArray()
            return Base64.encodeToString(byteArray, Base64.DEFAULT)
        }

        @Throws(IllegalArgumentException::class)
        fun convert(base64Str: String): Bitmap? {
            val decodedBytes: ByteArray = Base64.decode(
                base64Str.substring(base64Str.indexOf(",") + 1),
                Base64.DEFAULT
            )
            return BitmapFactory.decodeByteArray(decodedBytes, 0, decodedBytes.size)
        }

        fun convert(bitmap: Bitmap): String? {
            val outputStream = ByteArrayOutputStream()
            bitmap.compress(Bitmap.CompressFormat.JPEG, 90, outputStream)
            return Base64.encodeToString(outputStream.toByteArray(), Base64.DEFAULT)
        }

        fun crop(
            src: Bitmap, w: Int, h: Int,
            horizontalCenterPercent: Float, verticalCenterPercent: Float
        ): Bitmap {
            require(!(horizontalCenterPercent < 0 || horizontalCenterPercent > 1 || verticalCenterPercent < 0 || verticalCenterPercent > 1)) {
                ("horizontalCenterPercent and verticalCenterPercent must be between 0.0f and "
                        + "1.0f, inclusive.")
            }
            val srcWidth = src.width
            val srcHeight = src.height
            // exit early if no resize/crop needed
            if (w == srcWidth && h == srcHeight) {
                return src
            }
            val m = Matrix()
            val scale = Math.max(
                w.toFloat() / srcWidth,
                h.toFloat() / srcHeight
            )
            m.setScale(scale, scale)
            val srcCroppedW: Int
            val srcCroppedH: Int
            var srcX: Int
            var srcY: Int
            srcCroppedW = Math.round(w / scale)
            srcCroppedH = Math.round(h / scale)
            srcX = (srcWidth * horizontalCenterPercent - srcCroppedW / 2).toInt()
            srcY = (srcHeight * verticalCenterPercent - srcCroppedH / 2).toInt()
            // Nudge srcX and srcY to be within the bounds of src
            srcX = Math.max(Math.min(srcX, srcWidth - srcCroppedW), 0)
            srcY = Math.max(Math.min(srcY, srcHeight - srcCroppedH), 0)
            val cropped =
                Bitmap.createBitmap(src, srcX, srcY, srcCroppedW, srcCroppedH, m, true /* filter */)
            return cropped
        }

        fun base64ToBitmap(base64: String): Bitmap {
            val decodedBytes = Base64.decode(base64.replace("data:image/jpeg;base64,", ""), Base64.DEFAULT)
            return BitmapFactory.decodeByteArray(decodedBytes, 0, decodedBytes.size)
        }

        fun dpToPx(dpi: Int, dp: Int): Float {
            return dp * dpi / 160f
        }

        fun pxToDp(px: Int, dpi: Int): Float {
            return px * 160f / dpi
        }

        fun rotateBitmapToStraight(srcBmp: Bitmap, cameraDegree: Int, mirrorFlipped: Boolean = false): Bitmap {
//            Helpers.printLog("rotateBitmapToStraight $cameraDegree mirrorFlipped $mirrorFlipped")
            val matrix = Matrix()
            // Mirror is basically a rotation
            matrix.setScale(1f, if (mirrorFlipped) -1f else 1f)
            matrix.postRotate(cameraDegree.toFloat())
            return Bitmap.createBitmap(
                srcBmp,
                0,
                0,
                srcBmp.width,
                srcBmp.height,
                matrix,
                false
            )
        }

        fun getBitmapFromUri(contentResolver: ContentResolver, imgUri: Uri?): Bitmap? {
            Helpers.printLog("getBitmapFromUri - $imgUri")
            if (imgUri != null) {
                val inputStream = contentResolver.openInputStream(imgUri)
                if (inputStream != null) {
                    Helpers.printLog("Picked image from inputStream $imgUri")
                    val exif = androidx.exifinterface.media.ExifInterface(inputStream)
                    val rotation = when (exif.getAttributeInt(androidx.exifinterface.media.ExifInterface.TAG_ORIENTATION, androidx.exifinterface.media.ExifInterface.ORIENTATION_NORMAL)) {
                        6 -> 90
                        3 -> 180
                        8 -> 270
                        else -> 0
                    }
                    var tmpBitmap = rotateBitmapToStraight(MediaStore.Images.Media.getBitmap(contentResolver, imgUri), rotation)
                    Helpers.printLog("Picked image: $imgUri with Rotation $rotation ${tmpBitmap!!.width} ${tmpBitmap!!.height} ${tmpBitmap!!.byteCount}")
                    tmpBitmap = resizeImageFromGallery(tmpBitmap!!)
                    Helpers.printLog("Picked image: Compress ${tmpBitmap!!.byteCount} ${tmpBitmap!!.width} ${tmpBitmap!!.height}")
                    return tmpBitmap
                }
            }
            return null
        }

        fun imageProxyToBitmap(image: ImageProxy): Bitmap {
            val matrix = Matrix()
            val planeProxy = image.planes[0]
            val buffer: ByteBuffer = planeProxy.buffer
            val bytes = ByteArray(buffer.remaining())
            val exifInterface = ExifInterface(ByteArrayInputStream(bytes))
            val orientation: Int = exifInterface.getAttributeInt(ExifInterface.TAG_ORIENTATION, 1)
            buffer.get(bytes)
            var bitmap = BitmapFactory.decodeByteArray(bytes, 0, bytes.size)
            when (orientation) {
                ExifInterface.ORIENTATION_ROTATE_90 -> {
                    matrix.postRotate(90f)
                    bitmap = Bitmap.createBitmap(
                        bitmap, 0, 0,
                        bitmap.getWidth(), bitmap.getHeight(),
                        matrix, true
                    )
                }

                ExifInterface.ORIENTATION_ROTATE_180 -> {
                    matrix.postRotate(180f)
                    bitmap = Bitmap.createBitmap(
                        bitmap, 0, 0,
                        bitmap.getWidth(), bitmap.getHeight(),
                        matrix, true
                    )
                }

                ExifInterface.ORIENTATION_ROTATE_270 -> {
                    matrix.postRotate(270f)
                    bitmap = Bitmap.createBitmap(
                        bitmap, 0, 0,
                        bitmap.getWidth(), bitmap.getHeight(),
                        matrix, true
                    )
                }

                else -> {}
            }
            return bitmap
        }

